(19)     = Engagement delayed because AC has not been disengaged enough time. AC_DELAY_DURING_UPSHIFT (20)                 = Engagement delayed during upshift. AC_DELAY_DURING_DOWNSHIFT (21)               = Engagement delayed during downshift. AC_ENGAGE_ON_SCAN_TOOL_REQUEST (22)          = A Scan Tool has requested and been granted an engagement. AC_DISENGAGE_ON_SCAN_TOOL_REQUEST (23)       = A Scan Tool has requested and been granted a disengagement.", "", "", "", "", "", false)},
