            {"obdEvap.DiagState", new MySymbol("FF0L", "SCALAR", 1.0, "status", "Shows the evap diagnose all different states : 0 = ignition off 1 = diagnose interrupted 2 = precondition OK 3 = test phase 0 condition during test OK 4 = test phase 0 OK 5 = test phase 1 condition during test OK 6 = test phase 2 OK 7 = test phase 2 condition during test OK 8 = diagnose done, either ok or fault RANGE      : 0 - 8", "", "", "", "", "", false)},
            {"obdEvap.ActiveTest", new MySymbol("FF0L", "SCALAR", 1.0, "status", "1 - 0,5 mm test with no vehicle speed 2 - 1mm -> test with vehicle speed 3 - big leak, filler cap RANGE      : 1 - 3", "", "", "", "", "", false)},
            {"obdEvap.BreakPreCondition", new MySymbol("FF0L", "SCALAR", 1.0, "status", "1 = obdEvap.ST_NeedForSpeed = 1 2 = In.v_Vehicle < pEvapTestCal->v_loLim or In.v_Vehicle > pEvapTestCal->v_hiLim 3 = obdFuelDetermination.V_FuelTankFilt <= EvapDiagCal.V_FuelMin (-4L for prod.test) 4 = obdFuelDetermination.V_FuelTankFilt >= EvapDiagCal.V_FuelMax 5 = Fault.p_FuelTank > 0 (electrical or rationality error on ptank) 6 = obdEvap.p_FuelTankFilt >= EvapDiagCal.p_MaxTank (+200Pa for prod.test) 7 = Unused 8 = obdEvap.n_BrakeChanges >= pEvapTestCal->n_BrakeChangeLim (+5 for Production- and Workshop-test) 9 = In.T_Engine < PurgeCal.T_EngineLim if obdEvap.ST_ColdStart = 1, else FuelAdap.ST_PurgeAllow = 0 (PURGE_NOT_ALLOWED) 10 = obdEvap.ST_ColdStart = 0 and purgeFirstStartRampOK = 0 12 = Purge.p_DiffNormal > -150 13 = Purge.AdaptionEvap < pEvapTestCal->PurgeloLim 14 = obdpTankAdap.ST_FaultCode > 0 15 = In.v_Vehicle has not been more than 44 Km/h for more than EvapTestCal->t_breakWaitTime 16 = PowerTrainRelay diagnosis has reported fault 17 = FCut.ST_FuelCut = 1 18 = obdEvap.p_AirAmbientDelta > pEvapTestCal->p_AirAmbientDelta 19 = If obdEvap.p_AirAmbientDelta has been out of limit for active test. This will stop active test for rest of the DCY 20 = Fault.v_Vehicle > 0 21 = obdCCV.ST_FaultCode > 0 22 = OBDAdap.ST_PurgeFault > 0 23 = obdBrakeLight.ST_FaultCode > 0 24 = obdTEng.ST_FaultCode > 0 25 = obdTAir.ST_FaultCode > 0 27 = obdEvap.ST_FillerCapTestDone = 1 and obdEvap.ActiveTest = 3 28 = obdEvap.ST_ColdStartExt = 0 and obdEvap.ActiveTest is not 3 and DiagActive.ST_EvapProductionTest = 0 29 = Lambda.Status > 0, T9: WBLam.ST_Control or LamMast.ST_ActiveLambdaReq is not 4 30 = obdEvap.p_FuelTankFilt < pEvapTestCal->p_Level1Ramp1 31 = obdEvap.N_VapourTest1 >= EvapDiagCal.N_VapourLimTest1 and obdEvap.ActiveTest = 1 (No more Test1 attempts, due to too many Test1 have been aborted by evaporaion) 32 = obdEvap.N_VapourTest2 >= EvapDiagCal.N_VapourLimTest2 and obdEvap.ActiveTest = 2 (No more Test2 attempts, due to too many Test2 or Test3 have been aborted by evaporation.) 33 = ManifoldAbsolutePressureSensor diagniosis has reported fault 34 = obdCCV.ST_ActiveRationality = 1 (the purge valve may already be controlled) 35 = obdCore.ST_DiagPriority is not 0 (another diagnose has run priority) 36 = obdSAI.WSDiagState is not 0 (SAI workshop test is running) 37 = Purge.ST_O2SensDiagFreeze nonzero (O2S Response test is running) 38 = The engine is running on idle and obdevap.activetest is 2 or 3 39 = TAmbMod.T_AirAmbient < EvapDiagCal.T_LoLim or TAmbMod.T_AirAmbient > EvapDiagCal.T_AmbHiLim 40 = TAmbMod.T_AirAmbAtStart < EvapDiagCal.T_LoLim or obdCore.T_AirInletStart < EvapDiagCal.T_LoLim", "", "", "", "", "", false)},
            {"obdEvap.EvapPreBreakTemp", new MySymbol("FF0L", "SCALAR", 1.0, "status", "See obdEvap.BreakPreCondition for explanaition about the values.This shows the same as obdEvap.BreakPreCondition except that the ambient break conditions is excluded.", "", "", "", "", "", false)},
            {"obdEvap.BreakCondDurTest", new MySymbol("FF0L", "SCALAR", 1.0, "status", "2 = In.v_Vehicle < (obdEvap.v_VehicleSpeedPrecondition - pEvapTestCal->v_Diff) or In.v_Vehicle > (obdEvap.v_VehicleSpeedPrecondition + pEvapTestCal->v_Diff) 3 = obdFuelDetermination.V_FuelTankFilt <= EvapDiagCal.V_FuelMin (-4L for prod. test) 4 = obdFuelDetermination.V_FuelTankFilt >= EvapDiagCal.V_FuelMax 5 = Fault.p_FuelTank > 0 (electrical or rationality error on ptank) 6 = obdEvap.p_FuelTankFilt >= EvapDiagCal.p_MaxTank (+200Pa for prod.test) 8 = obdEvap.n_BrakeChanges >= pEvapTestCal->n_BrakeChangeLim (+5 for Production- and Workshop-test) 12 = Purge.p_DiffNormal >= -150 and obdEvap.DiagState < 6 13 = Purge.HCCont > (obdEvap.HCContPrecondition + pEvapTestCal->HCContDiff) 14 = m_Delta > EvapDiagCal.m_Delta or m_Delta < (0 - EvapDiagCal.m_Delta) 17 = FCut.ST_FuelCut = 1 18 = obdEvap.p_AirAmbientDelta > pEvapTestCal->p_AirAmbientDelta 19 = If obdEvap.p_AirAmbientDelta has been out of limit for active test. This will stop active test for rest of the DCY 20 = obdEvap.p_FuelTankFilt < pEvapTestCal->p_MinTank 21 = obdEvap.ST_ValveLockedByDiagnose = 1 and Purge.Status is not 6 22 = Purge.DiagFlow > 0 and Out.PWM_PurgeValve <= 0 34 = obdEvap.Ramp0 < EvapDiagCal.ramp0LoLim 35 = The engine is running on idle and obdevap.activetest is 2 or 3 36 = Purgeflow is too low due to max fuelfactor 101 = obdEvap.p_FuelTankFilt < pEvapTestCal->p_Level1Ramp1 first time in ramp 1 102 = Fuellevelripple determined 103 = obdEvap.Ramp0 > pEvapTestCal->ramp0HiLim 105 = obdEvap.DiffR2Result[i] >= EvapDiagCal.maxPosR2Diff (Fuellevelripple during ramp2 evaluation small pos direction) 106 = obdEvap.DiffR2Result[i] < EvapDiagCal.maxNegR2Diff (Fuellevelripple during ramp2 evaluation small neg direction) 108 = T8: If Lambda.LambdaInt diff of obdEvap.LambdaPrecondition T9: If (WBLam.FuelFac - 1.0) diff of obdEvap.LambdaPrecondition 150 -> 200 = Big leak errors detected, needed 2 for error report when ignition off 254 = OBDAdapEvap.Evap2BigResDiff > 0", "", "", "", "", "", false)},
