            {"ActualIn.ST_AlternatorLTerm", new MySymbol("FF0L", "SCALAR", 1.0, "bool", "Alternator L Terminal input 0 = alternator is not loading 1 = alternator is loading Note: In T9 this data is a digital copy of PWM_AlternatorLTerm. The application is the same in T8 and T9 using the digital L term, but T9 is prepared to use a PWM controlled generator.", "", "", "", "", "", false)},
