            {"LimpIn.ST_WhSpdSnsDgnCmp", new MySymbol("FF0L", "SCALAR", 1.0, "bool", "Wheel Speed Sensing Diagnostic Completed is transmitted by Platform. The signal is set to 'True' when the ABS/TCS Control Module has completed its diagnostics checks for monitoring of the Wheel Speed Sensors and the ECU internal faults at least once during the latest ignition cycle.", "", "", "", "", "", false)},
            {"LimpIn.ST_EngyMgtMinIdlBstLvlRq", new MySymbol("FF0L", "SCALAR", 1.0, "status", "Elevated idle engine speed UNIT       : bool 0 = No Boost Requested 1 = Boost Level 1 2 = Boost Level 2 3 = Boost Level 3", "", "", "", "", "", false)},
            {"LimpIn.ST_CrsCntCncRq", new MySymbol("FF0L", "SCALAR", 1.0, "bool", "Cruise Control Cancel Request is transmitted by the CIM. The signal could be sent with a value of 1 (TRUE) to inform the ECM to cancel cruise due to one of the following reasons: 1. Cruise cancel switch is pressed 2. Parking brake is set 3. A problem with the brake system is detected", "", "", "", "", "", false)},
            {"LimpIn.ST_CrsCntOnSwAtv", new MySymbol("FF0L", "SCALAR", 1.0, "bool", "Cruise Control On Switch Active This signal represents the status of the Cruise Control On switch.", "", "", "", "", "", false)},
            {"LimpIn.ST_CrsCntRsmSwAtv", new MySymbol("FF0L", "SCALAR", 1.0, "bool", "Cruise Control Resume Switch Active This signal represents the status of the Cruise Control Resume switch.", "", "", "", "", "", false)},
            {"LimpIn.ST_CrsCntSetSwAtv", new MySymbol("FF0L", "SCALAR", 1.0, "bool", "Cruise Control Set Switch Active This signal represents the status of the Cruise Control Set switch.", "", "", "", "", "", false)},
            {"LimpIn.ST_CrsCntSwFld", new MySymbol("FF0L", "SCALAR", 1.0, "bool", "Cruise Control Switch Failed This signal indicates if a failure of the cruise control switch has been detected.", "", "", "", "", "", false)},
            {"LimpIn.Cnt_CrsCntlAliveRC", new MySymbol("FF0L", "SCALAR", 1.0, "counts", "Cruise Control Alive Rolling Count The signal indicates that the senders processing software module is still alive. The rolling counter value shall be incremented in every transmitted message in the order 0, 1, 2, 3, 0.", "", "", "", "", "", false)},
            {"LimpIn.ST_CrusCntSwProt", new MySymbol("FF0L", "SCALAR", 1.0, "status", "Cruise Control Switch Protection Value The signal indicates that the senders processing software module still is working properly.", "", "", "", "", "", false)},
            {"LimpIn.Cnt_TCAliveRC", new MySymbol("FF0L", "SCALAR", 1.0, "counts", "Traction Control Alive Rolling Count ´            The Rolling Counter shall be an incremented value in the following decimal order: 0, 1, 2, 3, 0,...  Three Rolling Counter update errors in a t.b.d. number (normally ten) of  consecutive frames will lead to an irreversible rejection of all further torque requests by Powertrain until the end of the respective driving cycle.", "", "", "", "", "", false)},
            {"LimpIn.ST_TCSysAtv", new MySymbol("FF0L", "SCALAR", 1.0, "bool", "Traction Control System Active Powertrain will cancel cruise control when the data value of this signal is 'True' for a calibratable time. 0 = False 1 = True", "", "", "", "", "", false)},
            {"LimpIn.ST_TCSysEnbld", new MySymbol("FF0L", "SCALAR", 1.0, "bool", "Traction Control System Enabled This signal is used by the traction control algorithm in the powertrain controller. Powertrain may also disable brake torque management when the traction control system has been turned off. 0 = False 1 = True", "", "", "", "", "", false)},
            {"LimpIn.ST_TCTrqIntvTyp", new MySymbol("FF0L", "SCALAR", 1.0, "status", "Traction Control Torque Intervention Type This signal indicates the type of the requested torque intervention. A torque reduction or increase is defined with respect to the calculated engine crankshaft torque. 0 = No Intervention 1 = Reduce Torque 2 = Increase Torque", "", "", "", "", "", false)},
            {"LimpIn.ST_TCTrqRdnRlzSg", new MySymbol("FF0L", "SCALAR", 1.0, "status", "Traction Control Torque Reduction Realization Suggestion If a smooth intervention is required or engine torque shall be limited for longer terms, e.g., to avoid transmission damages, 'Throttle Only' can be commanded to force use of throttle adjustment. If the torque intervention shall be only for short time, after which the engine shall return to the original torque as fast as possible, 'No Throttle Usage' can be commanded via the Traction Control Torque Intervention Type signal and the Powertrain electronics shall try to use only ignition retard or fuel cut-off. 0 = No suggestion 1 = No throttle usage 2 = Throttle only (no ignition usage)", "", "", "", "", "", false)},
            {"LimpIn.X_TrnActGr", new MySymbol("FF0L", "SCALAR", 1.0, "state", "Transmission Actual Gear. It is the engaged gear that Powertrain determines from the best available inputs such as - engine speed/vehicle speed ratio, - turbine speed/output speed ratio, - commanded gear, - Drive/Reverse pressure discretes, - PSM Transmission Gear Selector Position, - PRNDL Transmission Gear Selector position, - P/N switch discrete, - clutch discrete, depending upon application. The forward gear states are determined based on comparing the gear ratio across the input and output speed sensors to a calibrated range of ratios corresponding to each available forward gear. The Reverse and Neutral states are assigned just as the Transmission Gear Selector Position signal. Note:  Forward drive gear states are not updated to the currently engaged gear until Powertrain has determined that a gear shift is complete and stabilized. However, transmission 'engaged' state indications (Reverse and Neutral) are updated based upon detection of the Transmission Gear Selector Position. 0 = Shift in Process 1 = First Gear 2 = Second Gear 3 = Third Gear 4 = Fourth Gear 5 = Fifth Gear 6 = Sixth Gear 7 = Seventh Gear 8 = Reverse 9 = Neutral", "", "", "", "", "", false)},
            {"LimpIn.X_TrnGrSlctrPos", new MySymbol("FF0L", "SCALAR", 1.0, "status", "Transmission Gear Selector Position. It represents the driver-selected gear position. Powertrain commands the state of PRNDL based on the unfiltered value of the four Mode Indication switch inputs to the Powertrain electronics (PRNDL A, PRNDL B, PRNDL C, and PRNDL P) on electronically-controlled automatic transmissions. The Mode Indication switch inputs are read and processed every 12.5 ms. If the Mode Indication switch is failed, the transmission pressure switch (PSM) is used if available to determine PRNDL when in D1, D2, D3, D4, or R when the engine is running. The PSM is read and processed every 25 ms. The PSM information is invalid when the engine is not running or in Park or Neutral. Therefore, the validity bit shall be set to 'Invalid' when a valid PRNDL state cannot be determined due to a failure that does not allow a valid state to be determined or if the PRNDL position is actually between valid positions. Transmission Gear Selector Position Validity shall be set to 'Invalid' if the sensor providing the data has failed and a backup value cannot be determined. Transmission Gear Selector Position is typically used for display purposes however it may be monitored by other Platform devices for miscellaneous body functions. The Brake Apply Sensing System uses it in its algorithm for determining brake lamp operation in the event of a brake apply sensor failure. 0 = Shift In Progress 1 = First Gear 2 = Second Gear 3 = Third Gear 4 = Fourth Gear 5 = Fifth Gear 6 = Sixth Gear 7 = Seventh Gear 8 = Reverse 9 = Neutral A = Park B = Drive C = Overdrive D = Intermediate E = Low F = Manual", "", "", "", "", "", false)},
            {"LimpIn.ST_TrnGrShftDir", new MySymbol("FF0L", "SCALAR", 1.0, "status", "Transmission Gear Shift Direction The shift in progress states are used to communicate that a shift is occurring for automatic transmissions. The signal is set to the appropriate state when the respective shift solenoid state changes. The signal remains set throughout the shift delay, the ratio change and the end timing of the shift. The 'No Shift in Progress' signal state is assigned when no shifts are occurring (i.e. the transmission is in the steady state operating mode). 0 = No Shift in Progress 1 = Upshift in Progress 2 = Downshift in Progress", "", "", "", "", "", false)},
            {"LimpIn.ST_TrnTrqIntvTyp", new MySymbol("FF0L", "SCALAR", 1.0, "status", "Transmission Torque Intervention Type. It is used to provide the TCM with means to control the engine torque during gear shift. This signal indicates the type of the requested torque intervention. The default value is No Intervention, in which case Torque Request Value shall be ignored. 0 = No Intervention 1 = Reduce Torque 2 = Increase Torque", "", "", "", "", "", false)},
            {"LimpIn.ST_TrnTrqRdnRlzSg", new MySymbol("FF0L", "SCALAR", 1.0, "status", "Torque Reduction Realization Suggestion. It is used to provide the TCM with means to control the engine torque during gear shift. With this signal a certain type of torque realization can be requested. The default value is No Suggestion, in which case it is the ECMs responsibility to choose the proper means for the torque adjustment. If the torque intervention shall be only for short time after which the engine shall return to the original torque as fast as possible, No Throttle Usage can be commanded and the ECM shall try to use only ignition retard or fuel cut-off. If a smooth intervention is required or engine torque shall be limited for longer terms e.g. to avoid transmission damages, Throttle Only can be commanded to force use of throttle adjustment. 0 = No Suggestion 1 = No Throttle Usage 2 = Throttle Only", "", "", "", "", "", false)},
            {"LimpIn.ST_TrnTrqCnvCltSt", new MySymbol("FF0L", "SCALAR", 1.0, "status", "Transmission Torque Converter Clutch Status. The Transmission is equipped with a Torque Converter Clutch which is engaged at certain speed and gears to decrease the fuel consumption. The signal shows the status of the Torque Converter Clutch in the Transmission and is used for the engine anti-jerk function in the ECM. 0 = Disengaged (Open converter) 1 = Engaging   (Sliping lockup) 2 = Engaged    (Locked converter)", "", "", "", "", "", false)},
            {"LimpIn.ST_TrnEmsMlfAtv", new MySymbol("FF0L", "SCALAR", 1.0, "bool", "Transmission Emissions Related Malfunction Active. The data value is set to 'True' when the TCM has detected and stored an emission related DTC (Diagnostic Trouble Code). Transmission Emissions Related Malfunction Active is received by the Engine Control Module. It is used to control the MIL (Malfunction Indicator Lamp) for display purposes.", "", "", "", "", "", false)},
            {"LimpIn.ST_TrnNtrlCntMdAtv", new MySymbol("FF0L", "SCALAR", 1.0, "bool", "Transmission Neutral Control Mode Active. The transmission is equipped with a special function that makes it possible to activate neutral mode when - Drive position is selected, - vehicle speed is zero and - the brakes are applied. This function decrease the fuel consumption. The signal is used to keep a stable idle speed when the Transmission engage/disengage the clutches.", "", "", "", "", "", false)},
            {"LimpIn.ST_TrnWrmUpShftPtrn", new MySymbol("FF0L", "SCALAR", 1.0, "bool", "TCM warmup shift pattern command active. 0 = normal shift pattern, 1 = warmup shift pattern", "", "", "", "", "", false)},
            {"LimpIn.ST_ThrtlPrgrsnReq", new MySymbol("FF0L", "SCALAR", 1.0, "status", "Throttle Progression Request 0=Map A 1=Map B 2=Map C", "", "", "", "", "", false)},
            {"LimpIn.ST_TrnWntrShPtSt", new MySymbol("FF0L", "SCALAR", 1.0, "Num", "Transmission Winter Shift Pattern Status", "", "", "", "", "", false)},
            {"LimpIn.ST_TrnFrzFrStrRq", new MySymbol("FF0L", "SCALAR", 1.0, "bool", "Transmission Powertrain Freeze Frame Data Request Since not all data from the Engine is available on the CAN bus during normal communication, some data has to be sent from the ECM when the TCM detects and store its first OBDII DTC (Diagnostic Trouble Code).The freeze frame data is stored together with the DTC in the TCM. The data value is set to 'Take Freeze Frame' when the TCM wants the ECM to transmit the relevant freeze frame data. When the data value equals 'Take Freeze Frame', the ECM will take the action to collect and send the OBD-II freeze frame data to the TCM.", "", "", "", "", "", false)},
            {"LimpIn.ST_TrnEmRelDTC_Str", new MySymbol("FF0L", "SCALAR", 1.0, "status", "Transmission Emissions Related DTC: Stored The trouble code shall be transferred in the KW-2000 format without failure symptom. Only if the freeze frame request bit is set, a DTC shall be sent, otherwise value 00 hex. Always after ignition on, i.e. at the beginning of a driving cycle the value 00 has to be transmitted. If a DTC is sent by TCM (value  0), the DTC value shall remain constant for at least one second. The transmitted trouble code will not be stored in the ECM failure memory, but in the respective ECM Freeze Frame. 0 = False 1 = True", "", "", "", "", "", false)},
