            {"Lambda.Status", new MySymbol("FF0L", "SCALAR", 1.0, "status", "Status byte for closed loop integrator. 0  Closed loop activated. 1  Closed loop not enabled. 2  The load is below the value from 'MinLoadTab'. 3  Fuel enrichment in progress depending on ExhaustTempFuelEnrichment or FulloadJerkFuelEnrichment. 4  Fuel enrichment in progress depending on KnockFuelEnrichment. 5  Engine temperature is too low with released pedal. 6  Engine temperature is too low with pressed pedal. 7  Engine rpm is to low. 8  Positive transient, lean lambda and lambda integrator < 0. 9  Negative transient, rich lambda and lambda integrator > 0. 10  Fuel cut in progress. 11  Throttle in limphome mode. 12  Fault on signal or injection power stage. If front 02 sensor is faulty and FFFuel.ST_enable = TRUE, check FFFuel.ST_RearLambdaClosedLoop for lambda closed loop with the rear 02 sensor. 13  Engine not started 14  Waiting until number of combustions have passed (before sensor check). 15  Waiting until engine probe is warm. 16  Waiting until number of combustions have passed (after sensor check). 17  HotSoak in progress. 18  SAI Number of combustions to start closed loop not passed. Only valid when SAI is active. 19  SAI request lean clamp 20  Catalysator diagnose request open loop 21  LambdaStart not finished. 22  Sond diagnose request open loop 23  Single cylinder misfire diagnose request open loop 24  Service Bay Test request open loop 25  Blockheater request open loop 26  Blend high load adaptation in progress 27  Afterstart request open loop 28  jerk 29  Fueldyn fuelcut", "", "", "", "", "", false)},
