            {"CrsCntrlAdap.MissingCond", new MySymbol("FF0L", "SCALAR", 1.0, "Num", "Tells why Cruise Control didn't start Bit  0 (0x0001) (    1) = In.ST_BrakeLight || In.ST_BrakeSwitch Bit  1 (0x0002) (    2) = In.ST_ClutchSwitch Bit  2 (0x0004) (    4) = CrsCntrlProt.v_Actual < CrsCntrlCal.v_Min || Fault.n_WhAngVlcFL || Fault.n_WhAngVlcFR Bit  3 (0x0008) (    8) = AnySysActDisCruiseControl() Bit  4 (0x0010) (   16) = CrsCntrlProt.ST_DecLimitActive Bit  5 (0x0020) (   32) = CrsCntrlProt.ST_GearStatus == FALSE Bit  6 (0x0040) (   64) = CrsCntrlProt.ST_BrakeTestPerformed == FALSE Bit  7 (0x0080) (  128) = CrsCntrlProt.ST_OnSw == FALSE Bit  8 (0x0100) (  256) = (ECMStat.ST_ESP_TCS && (Fault.ST_TCSysAtv || Fault.ST_VehDynCntAtv)) Bit  9 (0x0200) (  512) = CrsCntrlProt.ST_ESPTCSActive Bit 10 (0x0400) ( 1024) = In.v_Vehicle > CrsCntrlCal.v_Max Bit 11 (0x0800) ( 2048) = ETCLimpMode.LimitedAcceleration || ETCLimpMode.BrakeManagement Bit 12 (0x1000) ( 4096) = CrsCntrlProt.ST_NegSpdOffsUSD Bit 13 (0x2000) ( 8192) = In.n_Engine < CrsCntrlCal.n_EngMin || In.n_Engine > CrsCntrlCal.n_EngMax Bit 14 (0x4000) (16384) = (CrsCntrlProt.ST_AliveRCFault && CrsCntrlCal.ST_UseRCFault) || (CrsCntrlProt.ST_CCSwProtectionFault && CrsCntrlCal.ST_UseSwProtFault) Bit 15 (0x8000) (32768) = CrsCntrlProt.ST_SwitchFailed", "", "", "", "", "", false)},
            {"CrsCntrlAdap.SwitchOffReason", new MySymbol("FF0L", "SCALAR", 1.0, "Num", "Tells why Cruise Control has been Switch off Bit  0 (0x0001) (    1) = In.ST_BrakeLight || In.ST_BrakeSwitch Bit  1 (0x0002) (    2) = In.ST_ClutchSwitch Bit  2 (0x0004) (    4) = CrsCntrlProt.ST_LwSpdDropOut Bit  3 (0x0008) (    8) = Fault.n_WhAngVlcFL || Fault.n_WhAngVlcFR Bit  4 (0x0010) (   16) = CrsCntrlProt.ST_DecLimitActive Bit  5 (0x0020) (   32) = CrsCntrlProt.ST_GearStatus == FALSE Bit  6 (0x0040) (   64) = CrsCntrlProt.ST_CanSw Bit  7 (0x0080) (  128) = Free Bit  8 (0x0100) (  256) = CrsCntrlProt.ST_ESPTCSActive Bit  9 (0x0200) (  512) = (ECMStat.ST_ESP_TCS && (Fault.ST_TCSysAtv || Fault.ST_VehDynCntAtv)) Bit 10 (0x0400) ( 1024) = Free Bit 11 (0x0800) ( 2048) = CrsCntrlProt.ST_NegSpdOffsUSD Bit 12 (0x1000) ( 4096) = In.n_Engine < CrsCntrlCal.n_EngMin || In.n_Engine > CrsCntrlCal.n_EngMax Bit 13 (0x2000) ( 8192) = (CrsCntrlProt.ST_AliveRCFault && CrsCntrlCal.ST_UseRCFault) || (CrsCntrlProt.ST_CCSwProtectionFault && CrsCntrlCal.ST_UseSwProtFault) Bit 14 (0x4000) (16384) = CrsCntrlProt.ST_SwitchFailed Bit 15 (0x8000) (32768) = Free", "", "", "", "", "", false)},
