            {"GearProt.X_TrnGrSlctrPos", new MySymbol("FF0L", "SCALAR", 1.0, "status", "Transmission Gear Selector Position. It represents the driver-selected gear position. Powertrain commands the state of PRNDL based on the unfiltered value of the four Mode Indication switch inputs to the Powertrain electronics (PRNDL A, PRNDL B, PRNDL C, and PRNDL P) on electronically-controlled automatic transmissions. The Mode Indication switch inputs are read and processed every 12.5 ms. If the Mode Indication switch is failed, the transmission pressure switch (PSM) is used if available to determine PRNDL when in D1, D2, D3, D4, or R when the engine is running. The PSM is read and processed every 25 ms. The PSM information is invalid when the engine is not running or in Park or Neutral.  Therefore, the validity bit shall be set to 'Invalid' when a valid PRNDL state cannot be determined due to a failure that does not allow a valid state to be determined or if the PRNDL position is actually between valid positions.  Transmission Gear Selector Position Validity shall be set to 'Invalid' if the sensor providing the data has failed and a backup value cannot be determined. Transmission Gear Selector Position is typically used for display purposes however it may be monitored by other Platform devices for miscellaneous body functions. The Brake Apply Sensing System uses it in its algorithm for determining brake lamp operation in the event of a brake apply sensor failure.  0 = Shift In Progress 1 = First Gear 2 = Second Gear 3 = Third Gear 4 = Fourth Gear 5 = Fifth Gear 6 = Sixth Gear 7 = Seventh Gear 8 = Reverse 9 = Neutral A = Park B = Drive C = Overdrive D = Intermediate E = Low F = Manual", "", "", "", "", "", false)},
