            {"FFBladProt.ST_subState", new MySymbol("FF0L", "SCALAR", 1.0, "hex", "State machine for blend adaptation (Blad) FFBladAdap.ST_state shows the actual state in the statemachine. FFBladProt.ST_subState shows what is done inside a state.  0x0000 - ECU is reflashed, force blend adaptation first start after reflash. 0x0100 - Blad function is in init state preparing for adaptation ...0x0101 - Waiting for FuelAdap to go into idle state 0x0200 - Waiting to perform first adap ...0x0201 - Engine coolant temp too low ...0x0202 - Start delay timer not finished ...0x0203 - Init start delay timer 0x0300 - Performing first adap ...0x0301 - Lambda controller not active ...0x0302 - Lambda controller reached end position and not regulating ...0x0303 - Rpm below limit ...0x0304 - Load below limit ...0x0305 - Load too low when Boff is active ...0x0306 - Too high load delta and not running in ECMStat.ST_ActiveAirDem 12 (idle) ...0x0307 - Too high rpm delta and not running in ECMStat.ST_ActiveAirDem 12 (idle) ...0x0308 - Waiting for signals to stabilize when entering adap window ...0x0309 - Adap is sampling calculated blend value ...0x030A - The sampled blend value is ramped into actual used blend value ...0x030C - Purge active ......0x030x - HL adap disabled or not ready to run ......0x031x - HL adap engine not started ......0x032x - HL adap O2 sensor not ready ......0x033x - HL adap lambda controller active ......0x034x - HL adap detects fuelcut ......0x035x - HL adap rpm delta too high ......0x036x - HL adap load delta too high ......0x037x - HL adap no enrich detected ......0x038x - HL adap enrich detected ......0x03Ax - HL adap start delay timer ......0x03Bx - HL adap ramp lean ......0x03Cx - HL adap ramp rich ......0x03Fx - HL adap finish 0x0400 - Waiting to perform second adap ...0x0401 - Engine coolant temp to low ...0x0402 - Start delay timer not finished ...0x0403 - Init start delay timer 0x0500 - Performing second adap ...0x0501 - Lambda controller not active ...0x0502 - Lambda controller reached end position and not regulating ...0x0503 - Rpm below limit and not running in ECMStat.ST_ActiveAirDem 12 (idle) ...0x0504 - Load below limit and not running in ECMStat.ST_ActiveAirDem 12 (idle) ...0x0505 - Load too low when Boff is active ...0x0506 - Too high load delta ...0x0507 - Too high rpm delta ...0x0508 - Waiting for signals to stabilize when entering adap window ...0x0509 - Adap is sampling calculated blend value ...0x050A - The sampled blend value is ramped into actual used blend value ...0x050C - Purge active 0x0600 - Blad is finished ...0x0601 - Finished both ADAP1 and ADAP2 ...0x0602 - Comes from DISABLED 0xFF00 - Blad disabled and state machine is not active 0xFFFF - Serious error, user should contact someone", "", "", "", "", "", false)},
