            {"SAIAdap.ST_status", new MySymbol("FF0L", "SCALAR", 1.0, "hex", "State and status for SAI function. // MAIN STATES 0x0000 - reset status (ECU powerup) 0x1000 - init state, always entered during start 0x2000 - run state, normal SAI action 0x3000 - pause state, SAI is paused due to one of below cond. 0x4000 - remove fuel state, SAI has finished and is removing SAI fuel 0x5000 - abort state, SAI is aborted due to one of below cond. 0x6000 - done state, SAI has completed a full SAI cycle 0xF000 - unknown state, should never happen // ABORT STATUS 0x0000 - no abort cond. 0x0100 - ignition key 0x0200 - no SAI hardware present (EOL setting) 0x0300 - ambient air temp exceeds limits 0x0400 - system action 0x0500 - blockheater active 0x0600 - battery voltage above limit 0x0700 - load too high 0x0800 - WCF active", "", "", "", "", "", false)},
