            {"FCut.CutStatus", new MySymbol("FF0L", "SCALAR", 1.0, "state", "Fuel cut status, indicates what caused the fuelcut: 0 - No fuelcut 1 - Ignition key turned off 2 - Acc pedal pressed during start 3 - Engine speed above limit 4 - Throttle block adaption active for the first time 5 - Engine pos lost 6 - Airmass guard ( pressure guard ) 7 - Immobilizer code not correct 8 - 9 - Starter Control Relay circuit short to ground action 10 - EngineShutdown reguested by ETC safety 11 - 12 - 13 - System action, disable faulty fuel injector 14 - Forced fuelcut by user in symbol FCut.n_ForceCutCyl[ n_CYL ], used to generate misfire. 15 - Transmission requests fuel cut 16 - Kill engine, after engine has started, if engine speed is to low 17 - System action requested from single cylinder misfire diagnosis 18 - Idle revving fuelcut requested 19 - Post Collision Fuel Shutoff 20 - Application conditions for 'Saab' fuel cut: 21 - Application conditions for 'Opel' fuel cut. 31 - Power management fuelcut on one cylinder 32 - Power management fuelcut on two cylinders 33 - Power management fuelcut on three cylinders 34 - Power management fuelcut on four cylinders 35 - Power management fuelcut on five cylinders 36 - Power management fuelcut on six cylinders", "", "", "", "", "", false)},
