            {"ManGrShftCal.t_MaxKeep", new MySymbol("FF0L", "SCALAR", 1.0, "ms", "Maximum time to keep the rpm on next gears syncronous rpm before nominal idle rpm will continue to ramp down. This timer starts when In.n_Engine is below ManGrShftProt.n_NextGear + 300", "", "", "", "", "", false)},
