            {"ManGrShftCal.FiltFac", new MySymbol("FF0L", "SCALAR", 1.0, "Num", "Filter factor used for the gear ratio. Formula: 100 * ( new_value - old_value ) +/- Const Filt_value = old_value + ------------------------------------------- Const if old_value > new_value -> - Const, if old_value <= new_value -> + Const Filt_value  -> ManGrShftProt.RatioFilt old_value   -> old ManGrShftProt.RatioFilt new_value   -> ManGrShftProt.Ratio Const       -> ManGrShftCal.FiltFac If Const = 1 to 8, effective filter is used (shift. instead of division). (100 & 0 = 100% new, 200 & 1 = 50% new, 400 & 2 = 25% new 800 & 3 = 12.5% new, 1600 & 4 = 6.25% new etc.)", "", "", "", "", "", false)},
            {"ManGrShftCal.ClutchMode", new MySymbol("FF0L", "SCALAR", 1.0, "Num", "Mode selection on how to set the gearshifting flag, ManGrShft.ST_GearShifting. Modes: 0 - Use only the In.ST_ClutchBrake1 1 - Use both the In.ST_ClutchBrake1 and if the clutch is pressed for more than 3 sec, start the gear ratio gearshift detection. 2 - Use only the gear ratio gearshift detection. Gear ratio gearshift detection: When the pedal is released below 10% is a high and low ratio limit calculated, ManGrShftProt.RatioLow and ManGrShftProt.RatioHigh, when the ratio is above the high limit or below the low limit is the ManGrShft.ST_GearShifting flag set. When the pedal is above 5% and a gear is detected and the ManGrShftProt.RatioDelta is below 5 will the ManGrShft.ST_GearShifting flag be cleared.", "", "", "", "", "", false)},
