        public static double GetSymbolUnit(string word)
        {
            // Try to get the result in the static Dictionary
            MySymbol result;
            if (_dict.TryGetValue(word, out result))
            {
                return result.unitVal;
            }
            else
            {
                return 1.0;
            }
        }
